import React, { useCallback } from 'react'
import { CreatePostForm } from '@UI/Organisms'
import { PostType } from '@API/REST'
import { useDispatch } from 'react-redux'
import styled from 'styled-components'
import { useRouter } from 'next/router'

const CreatePostWrapped = styled.div`
	display: grid;
	align-items: center;
	width: 500px;
	height: 100%;
	margin: 0 auto;
`
const New = (): React.ReactElement => {
	const dispatch = useDispatch()
	const router = useRouter()
	const onSubmit = useCallback(
		(data: PostType) => {
			dispatch({ type: 'CREATE_POST', payload: {data, history: router.history} })
		},
		[dispatch]
	)
	return (
		<CreatePostWrapped>
			<CreatePostForm onSubmit={onSubmit} />
		</CreatePostWrapped>
	)
}
export default New
